import React from 'react'
import './Locdialog.css'
import { getAgencyinfo, updateLocation } from '../../service/api';

const Locdialog = (props) => {
  const [city, setCity]=React.useState('');
  function handleChange(event){
    setCity(event.target.value);
  }
  // Locdialog.js
// Locdialog.js
function handleClick() {
  props.setloc(city);

  // Update the data structure sent to the backend
  const data = {
    city: city,
    cname: props.cname,
  };

  // Use .then() syntax to handle the asynchronous call
  updateLocation(data)
    .then((response) => {
      console.log(response); // Handle the response as needed

      getAgencyinfo()
        .then((agencyInfo) => {
          console.log(agencyInfo);
        })
        .catch((error) => {
          console.error(error);
        });
    })
    .catch((error) => {
      console.error(error);
    });
}


  return (
    <div>
        <div class="modal-dialog" role="document">
          <div class="modal-content">
            <div class="modal-header">
              <h5 class="modal-title">Enter your location</h5>
             
            </div>
            <div class="modal-body">
              <input type="text" className="form-control" name='comploc' placeholder='Enter city' onChange={handleChange}/>
            </div>
            <div class="modal-footer">
              <button type="button" class="btn btn-primary" onClick={handleClick}>Save changes</button>

            </div>

        </div>
      </div>
    </div>
  )
}

export default Locdialog
